function renderNumber(c) {
    c = Math.round(c);
    var d = "";
    if (c == 0) {
        return '<span class="text-h2">0</span>'
    }
    while (c > 0) {
        d = '<span class="text-h2">' + c % 10 + "</span>" + d;
        c = parseInt(c / 10);
        // if (c > 0) {
        //     d = '<span class="char">\\</span>' + d
        // }
    }
    return d
}

