function changeCounterPattern(obj,render){
    setTimeout(function(){
        obj.interval = setInterval(function(){
            if(obj.currentPattern.RemainTime <= 0){
            console.log(obj);

                clearInterval(obj.interval);
                if(obj.Patterns[obj.currentIndex + 1]){
                    obj.DelayToStart = obj.currentPattern.DelayToNextPattern;
                    obj.currentPattern = obj.Patterns[++obj.currentIndex];
                    console.log(obj.currentPattern);

                    changeCounterPattern(obj,render);
                }
            }else{
                obj.CurrentCount++;
                $(render).closest('.text-stagger').find('.text-h2,.char').remove();
                var h = renderNumber(obj.CurrentCount);
                $(h).insertAfter(render);
                obj.currentPattern.RemainTime -= obj.currentPattern.SecondPerUnit;
            }
        },obj.currentPattern.SecondPerUnit*1000)

    },obj.DelayToStart*1000)
}





