function convertDataToArray(i) {
    var h = [];
    for (var g in i) {
        var j = {};
        $html = $('[name="' + g + '"]');
        var f = "TextValue";
        var type_input = "Text";
        if ($html.attr("type") == "number") {
            f = "NumberValue"
            type_input = "Number";
        }
        j.Code = g;
        j[f] = i[g];
        j["ValueType"] = type_input;
        h.push(j)
    }
    return h
}

function checkValues(g) {
    var h = {};
    for (var f in g) {
        $this = $('[name="' + f + '"]');
        switch (typeof g[f]) {
            case "string":
                if ($this.attr("error")) {
                    if (!g[f].trim()) {
                        h[f] = $this.attr("error")
                    }
                }
                if ($this.attr("type") == "number") {
                    if (($this.attr("min") && !g[f].trim()) || parseInt(g[f].trim()) < parseInt($this.attr("min"))) {
                        $this.val($this.attr("min"));
                        g[f] = $this.attr("min")
                    }
                }
                if ($this.attr("type") == "email") {
                    var e = /^(([^<>()\[\]\\.,;:\s@"]+(\.[^<>()\[\]\\.,;:\s@"]+)*)|(".+"))@((\[[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}\.[0-9]{1,3}])|(([a-zA-Z\-0-9]+\.)+[a-zA-Z]{2,}))$/;
                    if (!e.test(g[f].trim())) {
                        h[f] = "Xin vui lng in email ng nh dng example@Gmail.com"
                    }
                }
                break;
            case "number":
                if (!g[f]) {
                    h[f] = $('[name="' + f + '"]').attr("error")
                }
                break
        }
    }
    return h
}

